    <script>
        var logData = []; // Your log data will go here
        var replayInProgress = false;

        function startReplay() {
            if (replayInProgress) return; // Prevent replay if already in progress
            replayInProgress = true;
            var outputElement = document.getElementById('output');
            outputElement.textContent = ''; // Clear previous output
            replayLog(logData, outputElement, 25); // 4x speed (100ms / 4)
        }

        function replayLog(logData, outputElement, replaySpeed) {
            let textOutput = "";
            let index = 0;

            function processEvent() {
                if (index < logData.length) {
                    let event = logData[index++];
                    if (event.event === 'keydown') {
                        textOutput = applyKey(event.key, textOutput);
                    }
                    outputElement.textContent = textOutput;
                    setTimeout(processEvent, replaySpeed);
                } else {
                    replayInProgress = false;
                }
            }

            processEvent();
        }

        function skipToEnd() {
            if (replayInProgress) return; // Prevent if replay is in progress
            var outputElement = document.getElementById('output');
            let textOutput = "";
            logData.forEach(event => {
                if (event.event === 'keydown') {
                    textOutput = applyKey(event.key, textOutput);
                }
            });
            outputElement.textContent = textOutput;
        }

        function applyKey(key, textOutput) {
            switch(key) {
                case "Enter":
                    return textOutput + "\n";
                case "Backspace":
                    return textOutput.slice(0, -1);
                case "ControlBackspace":
                    let lastSpace = textOutput.lastIndexOf(' ');
                    return textOutput.slice(0, lastSpace);
                default:
                    return !["Shift", "Ctrl", "Alt", "ArrowDown","ArrowUp","Control","ArrowRight","ArrowLeft"].includes(key) ? textOutput + key : textOutput;
            }
        }
